import React from "react";

import { NavLink } from "react-router-dom";

import { slide as Menu } from "react-burger-menu";

const Navigation = () => {
  return (
    <div>
      <div id='globalnav'>
        <div id='gnavLogo'>
          <p>
            <a href='Map.js'>Universität zu Köln</a>
          </p>
        </div>
        <NavLink to='/Kontakt'>Kontakt</NavLink>
        <NavLink to='/Kartenviewer'>Infos</NavLink>
        <NavLink to='/Kartenkatalog'>Gebäudeübersicht</NavLink>
        <NavLink to='/'>Lageplan</NavLink>
      </div>
      <Menu></Menu>
    </div>
  );
};

export default Navigation;
